def read_con():
    # uuid_str = str(uuid.uuid4())
    with open("./operevent_ui_data.pkl", "rb") as fp:
        data = pickle.load(fp)
    out_data = data[1]
    for his_data in out_data:
        rules = {}
        historyAiDataInfo = his_data.get("historyAiDataInfo")
        # 获取识别信息
        deepDataIdentification = historyAiDataInfo.get("deepDataIdentification")
        # 循环识别信息
        for udata in deepDataIdentification:
            imp_list = udata.get("imps")
            for imp in imp_list:
                imp['imp_uid'] = str(uuid.uuid4())
    return data


def rule_replace(data):
    out_data = data[1]
    for his_data in out_data:
        rules = {}
        historyAiDataInfo = his_data.get("historyAiDataInfo")
        # 获取识别信息
        deepDataIdentification = historyAiDataInfo.get("deepDataIdentification")
        con = historyAiDataInfo.get("deepCon")
        rule = historyAiDataInfo.get("deepRules")

        model_key = historyAiDataInfo.get("deepName")
        rules[model_key] = rule
        # o_data = deepDataIdentification
        deepDataIdentification_copy = copy.deepcopy(deepDataIdentification)
        intell_rule = handle_project(con, deepDataIdentification_copy)
        for key, rule in intell_rule.items():
            #print(rule)
            historyAiDataInfo["deepRules"] = rule
            res = an_data(deepDataIdentification_copy, intell_rule, con)
            historyAiDataInfo["deepOutcomeData"] = dict(res)
    return data


